import React, {useState} from 'react';

const UseEffect = () => {
    const [sum, setsum] = useState(0);

    function getval(){
        setsum(sum + 1);
    }
    return(
        <>
        <h1>Pooja Agrawal</h1>
        <button onClick = {getval}>Click me {sum}</button>
        </>
    )

}

export default UseEffect;
